@dev Internal function to handle depositing assets and minting shares to the specified receiver address.
@param caller Address of the caller who triggered the deposit.
@param receiver Address where the newly minted shares should be sent.
@param assets Amount of assets to be deposited.
@param shares Amount of shares to be minted.

@dev Called after withdrawing shares
@notice Withdraws shares to the given receiver into assets
@param shares The number of shares to withdraw
@param receiver The address that will receive the withdrawn assets
@param _totalSupplyBeforeWithdraw The total supply of the vault before the withdrawal of shares

@dev Called after withdrawing (ejecting) shares
@notice Withdraws shares to the given receiver without any pool swaps
@param shares The number of shares to withdraw
@param receiver The address that will receive the withdrawn assets
@param _totalSupplyBeforeWithdraw The total supply of the vault before the withdrawal of shares
@return assets The amount of assets retrieved by the user
@return pts The amount of PTs retrieved by the user
@return yts The amount YTs retrieved by the user

@dev Burns PTs, redeem IBTs, and sends corresponding assets to the user,
@param yieldAssets The yield accumulated and corresponding to the shares being withdrawn
@param ptToBurn The amount of PT/YT the user is withdrawing from the PT
@param ibtBalanceBefore The IBT balance of the LPV before the withdrawal started
@param receiver The address of the receiver of the assets
@return assets The amount of assets retrieved by the receiver

